import React from "react";
import "../../style/Products.scss";
import { popularProducts } from "../../data";
function index() {
  return (
    <section className="container-products">
      {popularProducts.map((item) => {
        return <div>{item.id}</div>;
      })}
    </section>
  );
}

export default index;
